'Job Fair for Youth at Baramulla'

A Mega Job Fair was organised by Chinar Warriors from 16-17 April 25 at Chinar YUVA Centre, Baramulla to promote employment opportunities for youth of Kashmir.

The event featured 28 prominent companies and connecting 3817 youths with over 1000 vacancies out of which 731 jobs were claimed on the spot across government and private sectors, as well as through the innovative "Self-Employment" initiative, sparking entrepreneurial dreams and igniting a new wave of youth-led enterprises.

#ChinarCorps remains committed in its dedication to empower the youth, fostering employment opportunities and building a strong foundation for a thriving future.

